import React from 'react';
import { useEffect } from 'react';
import './Home.css';
//import Menu from '../components/Menu';
import Card from '../components/Card';
import { useGetCurrentWeatherDataQuery } from '../Api/WeatherMapApi';

function Home(props: any) {

    const {data, isFetching} = useGetCurrentWeatherDataQuery("Popayan");
    
    return (

        <div >

            <div className='header'>

                <div>
                    <img className="logo" src="https://lh3.googleusercontent.com/1NWSffUULql2uPj0hT_WTwSTfmUv0yuXk0Rq0Q6tpcUZbMurPESyK8W2NBqpa8SRpA=w300" alt="" />
                </div>

                <h1 className="title">Página del Clima</h1>

                <form className="search-form">

                    <input type="text" placeholder="Buscar..." />

                    <button type="submit">Buscar</button>

                </form>

            </div>

            <div className='body'>

                <div className='cards-container'>
                    <Card />
                    <Card />
                    <Card />
                    <Card />
                </div>

            </div>

        </div>
    );
}

export default (Home);
